import React from "react";
import LeftInfo from "./profileInfo/leftInfo";
import RightInfo from "./profileInfo/rightInfo";

const ProfileInfo = () => {
  return (
    <React.Fragment>
      <div>Profile Info</div>
      <div>
        <LeftInfo />
        <RightInfo />
      </div>
    </React.Fragment>
  );
};

export default ProfileInfo;
